import React from "react";
import { useSelector } from "react-redux";

function Test(){
    const List = useSelector(state => state.hobby.list)
    console.log(List)

    return(
        <ul>
            {/* Render các phần tử trong list */}
            {List.map(item => (
                <li key={item}>{item}</li>
            ))}
        </ul>
    )
}
export default Test;
